import Wcards from './Wcards';
import { Route, Switch } from 'react-router-dom';
import { NavLink } from 'react-router-dom';


function App() {
  const Home = () => {
    return (<>
    <div className = "myfav">
        {/* <NavLink to="/"> home </NavLink>
        <NavLink to="/movies"> Movies </NavLink>

        <NavLink to="/web"> Web-Series </NavLink> */}
        <a href="/"> home </a>
        <a href="/movies"> Movies </a>

        <a href="/web"> Web-Series </a>
        </div> 

    </>
    );
}

  return (<>
    <h1 className = "tittle">Hello I am Harsh Bhatnagar</h1>
    <div className = "WholeSection">
    <div className = "leftmenu">
     <Home/>

    </div>
    <div className = "cards">
    <Switch>
    <Route exact path= "/" component = {Cards} />

    <Route exact path= "/movies" component ={Mcards} />
    <Route exact path= "/web" component ={Wcards} />
    </Switch>
    </div>
    </div>
    </>
  );
}

export default App;
